import Heading from "components/common/Heading";
import LayoutDashboard from "layout/LayoutDashboard";
import CampaignFeature from "modules/campaign/CampaignFeature";
import CampaingnGrid from "modules/campaign/CampaingnGrid";
import React from "react";

const CampaignPage = () => {
  return (
    <LayoutDashboard>
    <div className="flex items-center justify-between mb-10 bg-white rounded-3xl">
        <div className="flex items-start gap-x-6 ">
            <div className="flex items-center justify-center h-1 rounded-full w-14"></div>
        </div>
        <div></div>
    </div>
      <Heading number={4}>Your Campaign</Heading>
      <CampaingnGrid type="secondary">
        <CampaignFeature></CampaignFeature>
        <CampaignFeature></CampaignFeature>
        <CampaignFeature></CampaignFeature>
        <CampaignFeature></CampaignFeature>
      </CampaingnGrid>
    </LayoutDashboard>
  );
};

export default CampaignPage;
